import React from "react";
import ImageTwo from "../images/landingpic.jpg";

const Home = () => {
  return (
    <>
      <img
        src={ImageTwo}
        alt="enfamil"
        className="h-full rounded mb-50 shadow"
      />
      <div
        className="container flex flex flex-col-reverse md:flex-row
      items-center px-6 mx-auto mt-30 space-y-0 border border-red-500"
      >
        Looking for formula? Start with our store locator.
      </div>
    </>
  );
};

export default Home;
